import React, { Component } from 'react'
import axios from 'axios'


// const api = axios.create({
//     baseURL:"https://0399e06edad5.ngrok.io/covid19_patient_monitor/patient_vitals?p_id=789"
// })

export class Test extends Component {
	constructor(props) {
		super(props)

		this.state = {
      posts: [],
      errorMsg: '',
      arun :[]
        }

    }

    async getDefaultMovies ()  {
    
        try{const res = await axios.get(
          'https://0399e06edad5.ngrok.io/covid19_patient_monitor/patient_vitals', {
            params:{
                'p_id':'789'

            }
          }
        )
        console.log("in try block")
        console.log(res)
        const Data=res.data;
        this.setState({
            arun:Data
        })

    }
        catch(error){
            console.log("in catch block");
            console.log(error);


        }

      }
      componentDidMount(){
        this.getDefaultMovies()
    }
	render() {
        const { posts, errorMsg } = this.state
         
        console.log(this.state.arun)
		return (
			<div>
				{/* {this.state.arun.map((obj)=>{
                    return <h1>{obj}</h1>
                })} */}
                List of posts
				{posts.length
					? posts.map(post => <div key={post.id}>{post.title}</div>)
          : null}
        {errorMsg ? <div>{errorMsg}</div> : null}
            Hello world!
			</div>
		)
	}
}
